■商品説明■
RAINBOW SANDALS「レインボーサンダル」#301 シングルアーチレザーサンダルが入荷！上質なヌバック＆表革レザーをトップに、通常のソールの厚さのレインボー、当店一番人気、定番モデルのレザーサンダルです。クッション性のある抜群の履き心地に滑りにくいオリジナルのアウトソールと、パラシュートにも使われる耐久性のある素材を使ったナイロンストラップで、末長くご愛用頂けます。しかも相場をはるかに下回るスペシャルプライスにてご提供！<table width="100%" cellspacing="2" cellpadding="0" border="0">
