■商品説明■<br>
RAINBOW SANDALS「レインボーサンダル」から、#302 ダブルアーチレザーサンダルが入荷！上質なヌバックorレザーをトップに、レインボー最上級モデルのレザーサンダルです。ダブルレイヤー「分厚いソール」のため、スニーカーのような履き心地が楽しめます。滑りにくいオリジナルのアウトソールと、パラシュートにも使われる耐久性のある素材を使ったナイロンストラップで、末長くご愛用頂けます。しかも期間限定にてスペシャルプライスにてご提供！<table width="100%" cellspacing="2" cellpadding="0" border="0">
