ハワイで1946年に創業された歴史ある老舗ブランドISLAND SLIPPER「アイランド スリッパ」PT-203 スエード素材タイプが新入荷！表革レザーとはまた違った風合いがあり、履き心地抜群の柔らかなソフトスエードレザーを使用＆耐久性に優れ、滑りにくいラバーソールを使用！長時間はいても全く、疲れがないまさにキング オブ スリッパ！今でもハワイ生産にこだわり、現地はもちろん、日本でも大人気のブランド！２０１７春夏モデルが早くも新入荷！入荷数は少なめです。探していた方はぜひお早めに■天然皮革を使用している為、商品の特性として稀に色ムラや表面のキズ・シワが見受けられます。ご了承下さいませ。<table width="100%" cellspacing="2" cellpadding="0" border="0">
